                            <p class="mt-4 text-gray-500 dark:text-gray-400 text-sm leading-relaxed">
                                Днный курс разработан действующим прораммистом. Минимум теории и максимум практики. Курс расчитан на слушателей, которые никогда не сталкивались с программированием, но твердо уверенены, что хотят изменить свою жизнь к лучшему и стать настоящими программистами.
